    const r = [
      0.5 * sqrt(max(1 + u[0][0] - u[1][1] - u[2][2], 0)),
      0.5 * sqrt(max(1 - u[0][0] + u[1][1] - u[2][2], 0)),
      0.5 * sqrt(max(1 - u[0][0] - u[1][1] + u[2][2], 0)),
      0.5 * sqrt(max(1 + u[0][0] + u[1][1] + u[2][2], 0)),
    ];

    if (u[2][1] > u[1][2]) {
      r[0] = -r[0];
    }

    if (u[0][2] > u[2][0]) {
      r[1] = -r[1];
    }

    if (u[1][0] > u[0][1]) {
      r[2] = -r[2];
    }

