import { Device } from "@siteimprove/alfa-device";
import { Element, Text } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Name } from "../../name";
import { Node } from "../../node";

import { hasName } from "../../node/predicate/has-name";
import { hasValue } from "../../name/predicate/has-value";

const { test } = Predicate;

/**
 * @public
 */
export function hasAccessibleName<T extends Element | Text>(
  device: Device,
  predicate?: Predicate<Name>,
): Predicate<T>;

/**
 * @public
 */
export function hasAccessibleName<T extends Element | Text>(
  device: Device,
  name: string,
  ...rest: Array<string>
): Predicate<T>;

export function hasAccessibleName<T extends Element | Text>(
  device: Device,
  nameOrPredicate: Predicate<Name> | string = () => true,
  ...names: Array<string>
): Predicate<T> {
  const predicate =
    typeof nameOrPredicate === "string"
      ? hasValue(nameOrPredicate, ...names)
      : nameOrPredicate;

  return (node) => test(hasName(predicate), Node.from(node, device));
}

import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Role } from "../../role";

const { equals, property } = Predicate;

/**
 * @public
 */
export function hasExplicitRole(
  predicate?: Predicate<Role>,
): Predicate<Element>;

/**
 * @public
 */
export function hasExplicitRole<N extends Role.Name>(
  name: N,
  ...rest: Array<N>
): Predicate<Element>;

export function hasExplicitRole(
  nameOrPredicate: Predicate<Role> | Role.Name = () => true,
  ...names: Array<Role.Name>
): Predicate<Element> {
  let predicate: Predicate<Role>;

  if (typeof nameOrPredicate === "function") {
    predicate = nameOrPredicate;
  } else {
    predicate = property("name", equals(nameOrPredicate, ...names));
  }

  return (element) => Role.fromExplicit(element).some(predicate);
}

import { Device } from "@siteimprove/alfa-device";
import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Node } from "../../node";

/**
 * @public
 */
export function hasHeadingLevel(
  device: Device,
  predicate: Predicate<number> = (n) => !isNaN(n),
): Predicate<Element> {
  return (element) =>
    Node.from(element, device)
      .attribute("aria-level")
      .map((level) => Number(level.value))
      .some(predicate);
}

import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Role } from "../../role";

const { equals, property } = Predicate;

/**
 * @public
 */
export function hasImplicitRole(
  predicate?: Predicate<Role>,
): Predicate<Element>;

/**
 * @public
 */
export function hasImplicitRole<N extends Role.Name>(
  name: N,
  ...rest: Array<N>
): Predicate<Element>;

export function hasImplicitRole(
  nameOrPredicate: Predicate<Role> | Role.Name | undefined,
  ...names: Array<Role.Name>
): Predicate<Element> {
  let predicate: Predicate<Role>;

  if (typeof nameOrPredicate === "function") {
    predicate = nameOrPredicate;
  } else {
    predicate = property("name", equals(nameOrPredicate, ...names));
  }

  return (element) => Role.fromImplicit(element).some(predicate);
}

import { Device } from "@siteimprove/alfa-device";
import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { hasExplicitRole } from "./has-explicit-role";
import { hasAccessibleName } from "./has-accessible-name";

const { hasName, isScopedTo } = Element;
const { and, not, or } = Predicate;

/**
 * `<aside>`, `<form>` and `<section>` elements have a non-generic implicit role
 * only if they have an accessible name.
 * Alfa currently can't handle that and always give them a role.
 * {@link https://github.com/Siteimprove/alfa/issues/298}
 * @public
 */
export function hasIncorrectRoleWithoutName(
  device: Device,
): Predicate<Element> {
  return and(
    hasSuspiciousRole,
    not(hasExplicitRole()),
    not(hasAccessibleName(device)),
  );
}

/**
 * form and section without name are always roleless.
 * aside elements are roleless when scoped to sectioning content.
 */
const hasSuspiciousRole = or(
  hasName("form", "section"),
  and(hasName("aside"), isScopedTo("article", "aside", "nav", "section")),
);

import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";
import { hasExplicitRole } from "./has-explicit-role";
import { hasImplicitRole } from "./has-implicit-role";

const { not, test } = Predicate;

/**
 * @public
 */
export function hasNonDefaultRole(element: Element): boolean {
  return test(
    hasExplicitRole((explicit) =>
      test(
        not(hasImplicitRole((implicit) => implicit.equals(explicit))),
        element,
      ),
    ),
    element,
  );
}

