import { Device } from "@siteimprove/alfa-device";
import { Node } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Node as ariaNode } from "../..";

/**
 * Check if a node is included in the accessibility tree.
 *
 * @remarks
 * It's possible for a node itself to be ignored in the accessibility tree while
 * still having children that aren't.
 *
 * @public
 */
export function isIncludedInTheAccessibilityTree<T extends Node>(
  device: Device,
): Predicate<T> {
  return (node) => !ariaNode.from(node, device).isIgnored();
}

/**
 * Check if a node is ignored in the accessibility tree.
 *
 * @remarks
 * It's possible for a node itself to be ignored in the accessibility tree while
 * still having children that aren't.
 *
 * @public
 */
export function isIgnored<T extends Node>(device: Device): Predicate<T> {
  return (node) => ariaNode.from(node, device).isIgnored();
}

import { Element } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";

import { Role } from "../../role";

/**
 * Check if an element is marked as decorative.
 *
 * @public
 */
export const isMarkedDecorative: Predicate<Element> = (element) => {
  const role = element.attribute("role").flatMap((attribute) =>
    attribute
      .tokens()
      .filter(Role.isName)
      .map(Role.of)
      .reject((role) => role.isAbstract())
      .first(),
  );

  if (role.some((role) => role.isPresentational())) {
    return true;
  }

  switch (element.name) {
    case "img":
      return (
        role.isNone() &&
        element.attribute("alt").some((attribute) => attribute.value === "")
      );

    default:
      return false;
  }
};

