import { Device } from "@siteimprove/alfa-device";
import { Node } from "@siteimprove/alfa-dom";
import { Predicate } from "@siteimprove/alfa-predicate";
import { Style } from "@siteimprove/alfa-style";

import { isIncludedInTheAccessibilityTree } from "./is-included-accessibility-tree";

const { and } = Predicate;
const { isVisible } = Style;

/**
 * Check if a node is perceivable for all users.
 *
 * @remarks
 * A node is considered perceivable for all if it's visible and has inclusive
 * descendants that are not ignored in the accessibility tree.
 *
 * @public
 */
export function isPerceivableForAll<T extends Node>(
  device: Device,
): Predicate<T> {
  return and(isVisible(device), (node) =>
    node.inclusiveDescendants().some(isIncludedInTheAccessibilityTree(device)),
  );
}

import { Cache } from "@siteimprove/alfa-cache";
import { Element, Node } from "@siteimprove/alfa-dom";
import { Device } from "@siteimprove/alfa-device";
import { Predicate } from "@siteimprove/alfa-predicate";
import { Refinement } from "@siteimprove/alfa-refinement";
import { Context } from "@siteimprove/alfa-selector";
import { Style } from "@siteimprove/alfa-style";

const { hasAttribute, isElement } = Element;
const { or, test, equals } = Predicate;
const { and } = Refinement;
const { hasComputedStyle } = Style;

/**
 * Check if an element is programmatically hidden.
 *
 * While this only uses Style properties, this is thematically related to
 * accessibility and aria-* attributes and therefore lives in alfa-aria.
 *
 * @public
 */
export function isProgrammaticallyHidden(
  device: Device,
  context: Context = Context.empty(),
): Predicate<Element> {
  return or(
    hasComputedStyle(
      "visibility",
      (visibility) => visibility.value !== "visible",
      device,
      context,
    ),
    hasHiddenAncestors(device, context),
  );
}

const cache = Cache.empty<Device, Cache<Context, Cache<Node, boolean>>>();

function hasHiddenAncestors(
  device: Device,
  context: Context = Context.empty(),
): Predicate<Node> {
  return (node) =>
    cache
      .get(device, Cache.empty)
      .get(context, Cache.empty)
      .get(node, () =>
        test(
          or(
            // Either it is a programmatically hidden element
            and(
              isElement,
              or(
                hasComputedStyle(
                  "display",
                  ({ values: [outside] }) => outside.value === "none",
                  device,
                  context,
                ),
                hasAttribute("aria-hidden", equals("true")),
              ),
            ),
            // Or its parent is programmatically hidden
            (node: Node) =>
              node
                .parent(Node.fullTree)
                .some(hasHiddenAncestors(device, context)),
          ),
          node,
        ),
      );
}

import { Predicate } from "@siteimprove/alfa-predicate";
import { Element } from "@siteimprove/alfa-dom";

const { equals, or } = Predicate;

/**
 * Checks if an element is semantically disabled.
 *
 * While this only uses DOM properties, this is thematically related to
 * accessibility and aria-* attributes and therefore lives in alfa-aria.
 *
 * {@link https://alfa.siteimprove.com/terms/disabled}
 *
 * @public
 */
export const isSemanticallyDisabled: Predicate<Element> = or(
  // Alfa hub's definition uses the `:disabled` pseudo-class, which is
  // equivalent to "actually disabled" for HTML; we shortcut it here.
  Element.isActuallyDisabled,
  Element.hasAttribute("aria-disabled", equals("true")),
);

