import { Predicate } from "@siteimprove/alfa-predicate";

import { type Attribute } from "../../attribute";
import { type Node } from "../../node";

const { property } = Predicate;

/**
 * @public
 */
export function hasAttribute(predicate: Predicate<Attribute>): Predicate<Node>;

/**
 * @public
 */
export function hasAttribute(
  name: Attribute.Name,
  value?: Predicate<string>,
): Predicate<Node>;

export function hasAttribute(
  nameOrPredicate: Attribute.Name | Predicate<Attribute>,
  value: Predicate<string> = () => true,
): Predicate<Node> {
  if (typeof nameOrPredicate === "function") {
    return (node) => node.attribute(nameOrPredicate).isSome();
  }

  const name = nameOrPredicate;
  const predicate = property<Attribute, "value">("value", value);

  return (node) => node.attribute(name).some(predicate);
}

import { Predicate } from "@siteimprove/alfa-predicate";

import { Name } from "../../name";
import { Node } from "../../node";

/**
 * @public
 */
export function hasName(predicate?: Predicate<Name>): Predicate<Node>;

/**
 * @public
 */
export function hasName(name: string, ...rest: Array<string>): Predicate<Node>;

export function hasName(
  nameOrPredicate: Predicate<Name> | string = () => true,
  ...names: Array<string>
): Predicate<Node> {
  const predicate =
    typeof nameOrPredicate === "function"
      ? nameOrPredicate
      : Name.hasValue(nameOrPredicate, ...names);

  return (node) => node.name.some(predicate);
}

import { type Predicate } from "@siteimprove/alfa-predicate";

import { type Node } from "../../node";
import { type Role } from "../../role";

import { hasName } from "../../role/predicate/has-name";

/**
 * @public
 */
export function hasRole(predicate?: Predicate<Role>): Predicate<Node>;

/**
 * @public
 */
export function hasRole<N extends Role.Name>(
  name: N,
  ...rest: Array<N>
): Predicate<Node>;

export function hasRole(
  nameOrPredicate: Predicate<Role> | Role.Name = () => true,
  ...names: Array<Role.Name>
): Predicate<Node> {
  let predicate: Predicate<Role>;

  if (typeof nameOrPredicate === "function") {
    predicate = nameOrPredicate;
  } else {
    predicate = hasName(nameOrPredicate, ...names);
  }

  return (node) => node.role.some(predicate);
}

